import { Routes, Route } from 'react-router-dom';
import GamesList from './pages/GamesList';
import GamePage from './pages/GamePage';
import './App.css';

function App() {
  return (
    <Routes>
      <Route path="/" element={<GamesList />} />
      <Route path="/game/:id" element={<GamePage />} />
    </Routes>
  );
}

export default App;
